webpackJsonp([196],{1761:function(module,exports){module.exports="import React from 'react';\nimport PropTypes from 'prop-types';\nimport classNames from 'classnames';\nimport WixComponent from '../../BaseComponents/WixComponent';\nimport styles from './Image.scss';\n\nconst sizeMap = {\n  'Tiny Square': 'tiny',\n  'Small Square': 'small',\n  Portrait: 'portrait',\n  'Large Square': 'large',\n  'Cinema View': 'cinema'\n};\n\nconst types = ['Tiny Square', 'Small Square', 'Portrait', 'Large Square', 'Cinema View'];\n\nclass Image extends WixComponent {\n  static propTypes = {\n    imageSrc: PropTypes.string.isRequired,\n    imageSize: PropTypes.oneOf(types)\n  };\n\n  static defaultProps = {\n    imageSize: 'size1',\n    alt: 'no image'\n  };\n\n  render() {\n    const {\n      imageSrc,\n      imageSize,\n      alt\n    } = this.props;\n\n    return (\n      <img\n        className={classNames(styles[`size-${sizeMap[imageSize]}`])}\n        src={imageSrc}\n        alt={alt}\n        />\n    );\n  }\n}\n\nImage.types = types;\n\nexport default Image;\n"}});